class Data {
  Data({
    num? totalCategories,
    num? totalProducts,
    String? address,
    String? phone,
    String? gstNumber,
    String? printType,
    String? businessName,
    List<Categories>? categories,
  }) {
    _totalCategories = totalCategories;
    _totalProducts = totalProducts;
    _address = address;
    _phone = phone;
    _gstNumber = gstNumber;
    _printType = printType;
    _businessName = businessName;
    _categories = categories;
  }

  Data.fromJson(dynamic json) {
    _totalCategories = json['totalCategories'];
    _totalProducts = json['totalProducts'];
    _address = json['address'];
    _phone = json['phone'];
    _gstNumber = json['gstNumber'];
    _printType = json['printType'];
    _businessName = json['businessName'];
    if (json['categories'] != null) {
      _categories = [];
      json['categories'].forEach((v) {
        _categories?.add(Categories.fromJson(v));
      });
    }
  }
  num? _totalCategories;
  num? _totalProducts;
  String? _address;
  String? _phone;
  String? _gstNumber;
  String? _printType;
  String? _businessName;
  List<Categories>? _categories;
  Data copyWith({
    num? totalCategories,
    num? totalProducts,
    String? address,
    String? phone,
    String? gstNumber,
    String? printType,
    String? businessName,
    List<Categories>? categories,
  }) =>
      Data(
        totalCategories: totalCategories ?? _totalCategories,
        totalProducts: totalProducts ?? _totalProducts,
        address: address ?? _address,
        phone: phone ?? _phone,
        gstNumber: gstNumber ?? _gstNumber,
        printType: printType ?? _printType,
        businessName: businessName ?? _businessName,
        categories: categories ?? _categories,
      );
  num? get totalCategories => _totalCategories;
  num? get totalProducts => _totalProducts;
  String? get address => _address;
  String? get phone => _phone;
  String? get gstNumber => _gstNumber;
  String? get printType => _printType;
  String? get businessName => _businessName;
  List<Categories>? get categories => _categories;

  Map<String, dynamic> toJson() {
    final map = <String, dynamic>{};
    map['totalCategories'] = _totalCategories;
    map['totalProducts'] = _totalProducts;
    map['address'] = _address;
    map['phone'] = _phone;
    map['gstNumber'] = _gstNumber;
    map['printType'] = _printType;
    map['businessName'] = _businessName;
    if (_categories != null) {
      map['categories'] = _categories?.map((v) => v.toJson()).toList();
    }
    return map;
  }
}

